import "./details.scss";
import { Link, useLocation } from "react-router-dom";
import Navbar from "../../component/navBar/Navbar";

export default function Details() {
  const location = useLocation();
  const movie = location.state?.movie;
  console.log(location);

  return (
    <div>
    <Navbar />
        <div className="watch">
          <div className="back">
            <ArrowBackOutlined />
            Home
          </div>
          <video
            className="video"
            autoPlay
            progress
            controls
            src={movie.trailer}
          />

        </div>
    </div>

  );
}
